import "./NavBar.css"
import {useState} from 'react'

export function NavBar(){
    const [Toggled, setToggled] = useState(false);

      //Deal with link causing propgation 
    const handleLinkClick = (e) => {
        e.stopPropagation();
    };
    return(
    <nav>
        <div id = "Menu" onClick = {() => setToggled(!Toggled)}> Menu</div>
        <div id = {Toggled ? "MenuOn" : "MenuOff"}>
            <ul id = "navBar"> 
                <li><a onClick = {() => handleLinkClick(e)} href = "">HOME</a></li>
                <li><a onClick = {() => handleLinkClick(e)} href = "">GALLERY</a></li>
                <li><a onClick = {() => handleLinkClick(e)} href = "">CONTACT US</a></li>
            </ul> 
        </div>
    </nav>
    )
}
